text:
Обсудили вопросы:
1.	Создание корпоративного сайта компании;
2.	Разработка корпоративного стиля;
3.	Компании важен выход на внешний рынок по следующим направлениям деятельности – гидроизоляция (кровля и паркинги), земляные работы (сети, благоустройство территорий, теплотрассы), отделочные работы, генподряд, как таковой;
4.	Есть 29 предприятий – потенциальных клиентов;
5.	Конкурентная среда;
6.	Внедрение экосистемы сервисов для онлайн-коммуникаций и совместной работы команды - МТС Линк.

<@u:1efb60f7-9249-6e62-8247-6cb3115313f8> КП только на сайт пока делаем?
